window.bookSummaryJSON = "<p><b>Enjoying his time in the evil Order of the Malefic Viper, Jake finds himself unprepared as Earth calls…</b></p> <p>Out of nowhere, Jake gets his alchemy training interrupted as he is forced back to the first universe to deal with a sudden emergency. Earth has been invaded by another Chosen with plans that do not include a fair fight, assisted by natives unsatisfied with the status quo.</p> <p>The feeble political balance on Earth is shattered as factions take advantage of the sudden turmoil to exercise the wills of their gods. War breaks out, and every force finds themselves implicated one way or another.&nbsp;</p> <p>On his way to face the enemy Chosen, Jake explores parts of Earth he has never seen before, makes new allies, gets to know more of the Malefic Viper’s most treasured secrets through incredibly invasive visions of the past, improves his abilities, and gets plenty of those sweet, sweet levels.</p> <p>But before all that… it’s time to dispense justice upon the most evil beings in all of existence: Mushroom Men.</p> <p><b>Book 8 of the hit Primal Hunter LitRPG Series is here. Grab your copy today!</b></p> <p><b>About the Series:</b> Experience an Apocalypse LitRPG with levels, classes, professions, skills, dungeons, loot, and all of the great traits of Progression Fantasy and LitRPG that you've come to expect. Follow Jake as he explores this new vast multiverse filled with challenges and opportunities. As he grows in power and slowly transforms from a bored office worker to a true apex hunter.</p>"; 
